import React, { useEffect, useState } from "react";
import { getHttp } from "../../service/APIRequest";
import { userapi } from "../../service/Config";

export const UserList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getAllUsers();
  }, []);

  const getAllUsers = () => {
    getHttp(userapi + "allUsers")
      .then((response) => {
        console.log(response);
        setUsers(response);
      })
      .catch((error) => {
        console.log(error);
        // handle error
      });
    ///
  };

  return (
    <div>
      <h2>User List</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Username</th>
            <th>Email</th>
            {/* Other table headers */}
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.name}</td>
              <td>{user.username}</td>
              <td>{user.email}</td>
              {/* Other table cells */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
